INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10001, 1, "クローチェ", "2023/06/30 12:00:00", 126401, 1.47, 2, "2023/09/22 14:59:59", 1, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", -470.0, 2002, 0.0, 1);
