INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10003, 1, "ライラエル", "2023/06/30 12:00:00", 126501, 0.0, 2, "2023/09/22 14:59:59", 1, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10004, 1, "ライラエル", "2023/06/30 12:00:00", 126501, 0.0, 1, "2023/09/22 14:59:59", 2, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10005, 2, "リンド", "2023/09/15 15:00:00", 127702, 0.0, 2, "2023/12/22 14:59:59", 1, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10006, 2, "リンド", "2023/09/15 15:00:00", 127702, 0.0, 2, "2023/12/22 14:59:59", 2, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10007, 2, "ヴルム", "2023/09/15 15:00:00", 127802, 0.0, 1, "2023/12/22 14:59:59", 1, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10008, 2, "ヴルム", "2023/09/15 15:00:00", 127802, 6.5, 1, "2023/12/22 14:59:59", 2, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10009, 3, "アネモネ", "2023/12/15 15:00:00", 129602, 0.0, 1, "2024/03/22 14:59:59", 1, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10010, 3, "アネモネ", "2023/12/15 15:00:00", 129602, 0.0, 1, "2024/03/22 14:59:59", 2, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10011, 3, "ネフィ=ネラ", "2023/12/15 15:00:00", 129701, 0.0, 1, "2024/03/22 14:59:59", 1, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10012, 3, "ネフィ=ネラ", "2023/12/15 15:00:00", 129701, 6.2, 1, "2024/03/22 14:59:59", 2, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10013, 4, "カノン", "2024/03/15 15:00:00", 130301, 3.1, 5, "2024/06/22 14:59:59", 1, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", -470.0, 2002, 0.0, 3);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10014, 4, "カノン", "2024/03/15 15:00:00", 130301, 6.15, 2, "2024/06/22 14:59:59", 2, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", -470.0, 2002, 0.0, 3);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10015, 4, "ナーナ", "2024/03/15 15:00:00", 130401, 0.0, 2, "2024/06/22 14:59:59", 1, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10016, 4, "ナーナ", "2024/03/15 15:00:00", 130401, 3.35, 1, "2024/06/22 14:59:59", 2, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10017, 5, "ホウオウ", "2024/06/15 15:00:00", 130502, 0.0, 1, "2024/09/22 14:59:59", 1, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10018, 5, "ホウオウ", "2024/06/15 15:00:00", 130502, 3.18, 1, "2024/09/22 14:59:59", 2, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10019, 5, "ホウオウ", "2024/06/15 15:00:00", 130503, 0.0, 4, "2024/09/22 14:59:59", 3, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", -470.0, 2002, 0.0, 4);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10020, 5, "ネア", "2024/06/15 15:00:00", 123301, 4.9, 2, "2024/09/22 14:59:59", 1, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10021, 5, "ネア", "2024/06/15 15:00:00", 123301, 4.8, 2, "2024/09/22 14:59:59", 2, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10022, 6, "カリザ", "2024/09/15 15:00:00", 133301, 4.922, 1, "2024/12/22 14:59:59", 1, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", -470.0, 2002, 0.0, 3);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10023, 6, "カリザ", "2024/09/15 15:00:00", 133301, 9.638, 5, "2024/12/22 14:59:59", 2, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", -470.0, 2002, 0.0, 3);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10024, 6, "ミーア", "2024/09/15 15:00:00", 133401, 2.88, 2, "2024/12/22 14:59:59", 1, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10025, 6, "ミーア", "2024/09/15 15:00:00", 133401, 4.818, 1, "2024/12/22 14:59:59", 2, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", -470.0, 2002, 0.0, 5);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10026, 7, "グレイス", "2024/12/15 15:00:00", 133002, 1.78, 1, "2025/03/22 14:59:59", 1, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", -470.0, 2002, 0.0, 2);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10027, 7, "グレイス", "2024/12/15 15:00:00", 133002, 6.15, 7, "2025/03/22 14:59:59", 2, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", -470.0, 2002, 0.0, 1);
INSERT INTO `v1_085bc6528c62cb9744373c17519df15b4d404637e9f09372e2f4803b3a1d3ddf` VALUES (10028, 7, "ヴァイオレット", "2024/12/15 15:00:00", 133102, 4.28, 2, "2025/03/22 14:59:59", 1, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", -470.0, 2002, 0.0, 6);
